from dataclasses import dataclass
from typing import TypedDict, Union

from stw_py_api_runtime.gen_shared_types.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message


from stw_py_api_runtime.gen_shared_types.types.core.fs.file_crc_type import FileCrc
from stw_py_api_runtime.gen_shared_types.types.core.fs.file_id_type import FileId
from stw_py_api_runtime.gen_shared_types.types.core.fs.file_name_type import FileName
from stw_py_api_runtime.gen_shared_types.types.core.fs.file_time_type import FileTime


@dataclass
class FileInfo(_Message):

    # None
    id: FileId
    # None
    name: FileName
    # None
    size: uint32_t
    # None
    crc: FileCrc
    # None
    created: FileTime


class FileInfoDict(TypedDict):

    # None
    id: Union[FileId]

    # None
    name: Union[FileName]

    # None
    size: Union[uint32_t, int ]

    # None
    crc: Union[FileCrc]

    # None
    created: Union[FileTime]

